import React from "react";
import TypingText from "../components/TypingText";

function Home() {
  return (
    <div className="home-container">
      <TypingText
        text="Molecular Biology 101"
        className="home-title"
        speed={100} // milliseconds per letter
      />
    </div>
  );
}

export default Home;
